import './Hero.css';

function Hero() {
  return (
    <section className="hero">
      <h1>Вымышленный Продукт</h1>
      <p>Лучший продукт для всех ваших нужд!</p>
      <button>Узнать больше</button>
    </section>
  );
}

export default Hero;
